-- ----------------------------
-- Triggers structure for table TRANSACTION
-- ----------------------------
CREATE TRIGGER "C##XYZ"."ADD_TO_WALLET" BEFORE UPDATE ON "C##XYZ"."TRANSACTION" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW 
BEGIN
	if :OLD.WALLET_ID IS NULL THEN
		UPDATE WALLET SET AMOUNT = AMOUNT + :NEW.AMOUNT WHERE WALLET_ID = :NEW.WALLET_ID;
	ELSE	
		RAISE_APPLICATION_ERROR(-20000, 'cannot edit');
	END IF;
END;
