-- Triggers structure for table TRIP
-- ----------------------------
CREATE TRIGGER "C##XYZ"."ADDTICKET_TRIP" AFTER INSERT ON "C##XYZ"."TRIP" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW 
DECLARE
	M_ID VARCHAR2(100);
BEGIN 
	SELECT MODEL_ID INTO M_ID
	FROM VEHICLE
	WHERE VEHICLE_ID = :NEW.VEHICLE_ID;
	FOR R IN (SELECT * FROM MODEL WHERE MODEL_ID = M_ID)
	LOOP
		FOR u in 1..R.BUSINESS_SEATS
		LOOP
		END LOOP;
		
		FOR u in 1..R.ECONOMIC_SEATS
		LOOP
		END LOOP;
	END LOOP;
END;
/

